// src/components/ProductCard.js
import React from 'react';

const ProductCard = ({ product }) => {
  return (
    <div className="bg-pink rounded-lg p-4 text-center hover:shadow-lg transition-shadow duration-300">
      <img src={product.image} alt={product.name} className="h-48 w-full object-cover rounded-md mb-4" />
      <h3 className="text-xl font-semibold">{product.name}</h3>
      <p className="text-lg">{product.price}</p>
      <button className="interactive-button mt-4">View Details</button>
    </div>
  );
};

export default ProductCard;
